        single by Adele","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Rolling_in_the_Deep","revisions":"https://en.wikipedia.org/wiki/Rolling_in_the_Deep?action=history","edit":"https://en.wikipedia.org/wiki/Rolling_in_the_Deep?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Rolling_in_the_Deep"},"mobile":{"page":"https://en.wikipedia.org/wiki/Rolling_in_the_Deep","revisions":"https://en.wikipedia.org/wiki/Special:History/Rolling_in_the_Deep","edit":"https://en.wikipedia.org/wiki/Rolling_in_the_Deep?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Rolling_in_the_Deep"}},"extract":"\"Rolling
        in the Deep\" is a song by English singer-songwriter Adele from her second
        studio album, 21 (2011). It is the lead single and opening track on the album.
        The song was written by Adele and Paul Epworth. The singer herself describes
        it as a \"dark blues-y gospel disco tune\". In 2011, it was reportedly the
        biggest crossover hit in the United States since 1985; \"Rolling in the Deep\"
        gained radio airplay from many different radio formats. It was released on
        29 November 2010 as the lead single from 21 in digital download format. The
        lyrics describe the emotions of a scorned lover.","extract_html":"<p>\"<b>Rolling
        in the Deep</b>\" is a song by English singer-songwriter Adele from her second
        studio album, <i>21</i> (2011). It is the lead single and opening track on
        the album. The song was written by Adele and Paul Epworth. The singer herself
        describes it as a \"dark blues-y gospel disco tune\". In 2011, it was reportedly
        the biggest crossover hit in the United States since 1985; \"Rolling in the
        Deep\" gained radio airplay from many different radio formats. It was released
        on 29 November 2010 as the lead single from <i>21</i> in digital download
        format. The lyrics describe the emotions of a scorned lover.</p>"}'
